import React from 'react';

class Navbar extends React.Component {
	render() {
		return (
			<nav class="menu">
			  <ul>
			    <li><a href="#">Men</a></li>
			    <li><a href="#">Women</a></li>
			    <li><a href="#">Kids</a></li>
			    <i class="fas fa-search"></i>
			  </ul>
			</nav>
		)
	}
}

export default Navbar;
